window.bookSummaryJSON = "Amateur sleuth and baker extraordinaire Corinna Chapman is upstaged when the hot new bread chain, Best Fresh Bread, opens just down the street from her own bakery, Earthly Delights. Meanwhile Daniel's tall, blonde and gorgeous old friend is staying with him while she establishes a base and a business in Melbourne. <p>When Daniel starts making excuses, Corinna begins to worry about his absences and also the strange outbreak of madness which seems to be centred on Lonsdale Street. Will Corinna win through a maze of health regulations, missing boyfriends, sinister strangers, fraudulent companies, and back alley ambushes? Or will this be the end for the Earthly Delights Bakery?</p>"; 
